import { StyleSheet } from "react-native/Libraries/StyleSheet/StyleSheet";

const StylePassword = StyleSheet.create({
    passwordConteiner:{
        flex:1,
        backgroundColor:'#E3C07C'
    }
});

export default StylePassword;
